syntax = "proto3";

import "anemos/metastore/unused/import.proto";
import "anemos/metastore/unused/enumeration.proto";
import "google/protobuf/timestamp.proto";

package anemos.metastore.unused;

option java_package = "io.anemos.metastore.unused";

message Valid {

    enum EnumerationTest2 {
        UNKNOWN = 0;
        STARTED = 1;
        RUNNING = 2;
